const Projects = () => (
  <div className="main">
    <div>
      <h1>Select Projects.</h1>
    </div>
    <div className="projects--cards">
      <div className="card"></div>
      <div className="card card--desc"></div>
    </div>
    <div className="projects--cards">
      <div className="card"></div>
      <div className="card card--desc"></div>
    </div>
    <div className="projects--cards">
      <div className="card"></div>
      <div className="card card--desx"></div>
    </div>
    <style jsx>
      {`
        .main {
          display: flex;
          text-align: center;
          flex-direction: column;
          margin: 0 120px;
        }
        h1 {
          text-align: left;
          font-family: Montserrat;
          font-size: 45px;
        }
        .projects--cards {
          display: flex;
          padding: 25px 0px;
        }
        .card {
          display: flex;
          height: 350px;
          width: 50%;
          border: 1px solid;
        }
        .card--desc {
          border: none;
          box-shadow: 5px 5px 10px #999;
        }
      `}
    </style>
  </div>
);

export default Projects;
